import React from "react";
import Home from "./Home";
import "./Feed.css";
import BlogPost from "./pages/BlogPost";

<Routes>
  <Route path="/" element={<Home />} />
  <Route path="/projects" element={<Projects />} />
  <Route path="/blog/:id" element={<BlogPost />} />
</Routes>

function App() {
  return (
    <div className="App">
      <Home />
    </div>
  );
}

export default App;
